import React from 'react'
import '../styles/lien.css'
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
     <nav className='Nav'> 
        <Link className='lien-home' to="/">Home</Link>
        <Link className='lien-nav' to="/APropos">A propos</Link>
     </nav>
    )

}
